  OPTIONAL { 
    ?trigge dbo:occupation dbr:Military_person .
    ?trigge dbo:notableFor ?war1 .
    ?war1 rdf:type dbo:MilitaryConflict ;
          dbo:socialEvent true .
    ?claimToFame rdfs:label ?war1Label .
  }

  # Joaquín Blake's war
  OPTIONAL { 
    ?blake dbo:occupation dbr:Military_person .
    ?blake dbo:notableFor ?war2 .
    ?war2 rdf:type dbo:MilitaryConflict ;
          dbo:socialEvent true .
    ?claimToFame rdfs:label ?war2Label .
  }

  # Carl Pontus Gahn's notable achievements
  OPTIONAL { 
    ?gahn dbr:Carl_Pontus_Gahn .
    ?gahn dbo:notableFor ?event3 .
    ?event3 rdf:type dbo:Event ;
            dbo:socialEvent true .
    ?claimToFame rdfs:label ?event3Label .
  }

  # Match labels for specific individuals
  FILTER (
    EXISTS { ?trigge rdfs:label "Thomas Trigge"@en . } ||
    EXISTS { ?blake rdfs:label "Joaquín Blake"@en . } ||
    EXISTS { ?gahn rdfs:label "Carl Pontus Gahn"@en . }
  )
}
```

